import { BrowserWindow } from 'electron';
import { ipcMain } from 'electron';

export function registerPdfHandler() {
    ipcMain.handle('api/pdf', async (_event, contents) => {
        const pdfBuffer = await renderPageWithPuppeteer(contents);
        return pdfBuffer.buffer;
    });

    ipcMain.handle('api/ping', async (_event, contents) => {
        return { ok: true };
    });

    async function renderPageWithPuppeteer(html: string): Promise<Uint8Array<ArrayBufferLike>> {
        const window = new BrowserWindow({
            show: false,
            webPreferences: {
                offscreen: true // Enable offscreen rendering
            }
        });

        const loadPromise = new Promise<void>((resolve) => {
            window.webContents.once('did-finish-load', resolve);
        });

        await window.loadURL(`data:text/html,${encodeURIComponent(`<!DOCTYPE html>
    <html lang="en">
    <head>
        <meta charset="UTF-8">
        <title>PDF Export</title>
        <style>
            body {
                font-family: "Arial", "Roboto", "Noto Sans", sans-serif;
                font-size: 16px;
            }
        </style>
    </head>
    <body>
    <div style="display: flex; justify-content:end">
    <img style="width: 160px; height: auto" alt="Logo" src="data:image/png;base64," />
    </div>
         ${html}
    </body>
    </html>`)}`);
        await loadPromise;


        const pdfBuffer = await window.webContents.printToPDF({
            pageSize: 'A4',
            printBackground: true,
            landscape: true, 
            displayHeaderFooter: true,  // Enable header and footer
            headerTemplate: `
            <div class="pdf-header">
    
            </div>
            <style>
            /* General table styles */
                .pdf-header { 
                    font-size: 12px; 
                    text-align: center; 
                    padding: 10px; 
                }
                /* Hide header on page 1 */
                .pdf-header[page="1"] { display: none; }  
            </style>`,
            footerTemplate: `
                <div style="width: 100%; font-size: 12px; text-align: center; padding: 10px;">
                    <span>Page <span class="pageNumber"></span> of <span class="totalPages"></span></span>
                </div>`,
        });
        window.destroy(); // Clean up

        return pdfBuffer;
    }
}

